import React from "react";

const Produto = ({ nome, propriedade }) => {
  return (
    <>
      <div></div>
      <p>{nome}</p>
      <ul>
        {propriedade.map((propriedade) => (
          <li>{propriedade}</li>
        ))}
      </ul>
    </>
  );
};

export default Produto;
